  name: IDynamicMDOProvider
  nameWithType: IDynamicMDOProvider
  fullName: SuperOffice.CRM.Lists.IDynamicMDOProvider
  type: Interface
  assemblies:
  - SoDataBase
  namespace: SuperOffice.CRM.Lists
  summary: >-
    Interface defining an MDO list provider whose supported list names (can be more than one)

    are known at runtime. To qualify as a plugin, a class implementing this interface (or a subclass of it) should 

    also implement the <xref href="SuperOffice.Factory.IPlugin" data-throw-if-not-resolved="false"></xref> interface and the DynamicMDOProviderAttribute

    attribute. Interface implementation requirements

    can be satisifed by base classes, while the attribute must be on the derived class.
  example: []
